import { ListaPokemonsComponent } from './lista-pokemons.component';

@NgModule({
  declarations: [ListaPokemonsComponent],
  imports: [CommonModule, ListaPokemonsRoutingModule],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
